selector_to_html = {"a[href=\"#comandos-en-el-contenedor\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Comandos en el contenedor<a class=\"headerlink\" href=\"#comandos-en-el-contenedor\" title=\"Link to this heading\">#</a></h2><p>Para instalar nuestro programa en el contenedor, necesitamos ejecutar comandos\nen este. Para ello, tenemos <code class=\"code docutils literal notranslate\"><span class=\"pre\">lxc</span> <span class=\"pre\">exec</span> <span class=\"pre\">{contenedor}</span> <span class=\"pre\">--</span> <span class=\"pre\">{comando}</span></code>. Una\nforma interactiva, adecuada para pruebas, es ejecutar bash.</p>", "a[href=\"#referencias\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Referencias<a class=\"headerlink\" href=\"#referencias\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#crear-perfil-gui\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Crear perfil GUI<a class=\"headerlink\" href=\"#crear-perfil-gui\" title=\"Link to this heading\">#</a></h2><p>Por defecto, el comportamiento de los contenedores es para la ejecuci\u00f3n de\nservicios y aplicaciones de consola. Por eso, la ejecuci\u00f3n de una aplicaci\u00f3n\ngr\u00e1fica nos requiere una configuraci\u00f3n adicional, que es realizar el paso al\nsistema gr\u00e1fico de nuestro sistema hospedador.</p><p>El perfil gr\u00e1fico es definido con el siguiente c\u00f3digo (copia y pega en un nuevo\narchivo, <code class=\"code docutils literal notranslate\"><span class=\"pre\">lxdguiprofile.txt</span></code>).</p>", "a[href=\"#obtener-contenedor-base\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obtener contenedor base<a class=\"headerlink\" href=\"#obtener-contenedor-base\" title=\"Link to this heading\">#</a></h2><p>Una vez creado el perfil, lanzaremos un contenedor usando una imagen base, es\ndecir, sobre la cual desarrollaremos nuestra necesidad. Estas im\u00e1genes base se\nencuentran disponibles en la p\u00e1gina del proyecto y son bases de m\u00faltiples\ndistribuciones Linux, con versiones y arquitecturas diferentes.</p><p>Para nuestro fin, usaremos una base de Ubuntu 18.04 para arquitectura i386, que\ncorresponde a 32 bits. Puedes usar otra distribuci\u00f3n siempre y cuando disponga\nde la forma de instalar los paquetes necesarios y en versiones recientes (entre\nm\u00e1s reciente sea Wine, mejor).</p>", "a[href=\"#instalar-lxd\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Instalar LXD<a class=\"headerlink\" href=\"#instalar-lxd\" title=\"Link to this heading\">#</a></h2><p>Nuestro primer paso ser\u00e1 instalar el paquete LXD, el cual se encuentra\ndisponible a trav\u00e9s de m\u00faltiples gestores de paquetes de las distribuciones\nLinux pero tambi\u00e9n como paquete snap. Por facilidad, usar\u00e9 el paquete snap.</p>", "a[href=\"#ejecutar-ealite\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ejecutar EALite<a class=\"headerlink\" href=\"#ejecutar-ealite\" title=\"Link to this heading\">#</a></h2><p>Ahora, podemos usar el visor de Enterprise Architect.</p>", "a[href=\"#compartir\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Compartir<a class=\"headerlink\" href=\"#compartir\" title=\"Link to this heading\">#</a></h2><p>Para compartir el contenedor, puedes publicarlo y exportar la imagen.</p>", "a[href=\"#instalar-ealite\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Instalar EALite<a class=\"headerlink\" href=\"#instalar-ealite\" title=\"Link to this heading\">#</a></h2><p>Ahora que sabemos ejecutar comandos en el contenedor, instalaremos las\ndependencias y finalmente EALite.</p>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/ealite-abrir-proyecto-lxc.png\"><img alt=\"Acceso al sistema de archivos del contenedor y no solo de la unidad de Wine.\" src=\"../../../../_images/ealite-abrir-proyecto-lxc.png\" style=\"width: 480px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Acceso al sistema de archivos del contenedor y no solo de la unidad de Wine.</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#crear-contenedor-lxc-para-aplicacion-gui-ealite\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Crear contenedor LXC para aplicaci\u00f3n GUI - EALite<a class=\"headerlink\" href=\"#crear-contenedor-lxc-para-aplicacion-gui-ealite\" title=\"Link to this heading\">#</a></h1><p>El uso de contenedores en la industria del software se ha extendido ampliamente\ny no es de extra\u00f1ar, ofrece a los desarrolladores la posibilidad de mejorar el\naislamiento de sus servicios y de ah\u00ed hacerlo menos susceptible a errores por\ncolisiones con otros servicios o conflictos de dependencias. Al mismo tiempo,\nson una alternativa m\u00e1s amigable en recursos respecto a las m\u00e1quinas virtuales.</p><p>M\u00faltiples proveedores de infraestructura para nube ofrecen la opci\u00f3n de\ndesplegar los servicios a partir de un contenedor, y sin duda, facilita la\ndistribuci\u00f3n de entornos de desarrollo y aplicaciones.</p>", "a[href=\"#gestionar-archivos\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Gestionar archivos<a class=\"headerlink\" href=\"#gestionar-archivos\" title=\"Link to this heading\">#</a></h2><p>La gesti\u00f3n de archivos es realizada con los comandos <code class=\"code docutils literal notranslate\"><span class=\"pre\">file</span> <span class=\"pre\">pull</span></code> y\n<code class=\"code docutils literal notranslate\"><span class=\"pre\">file</span> <span class=\"pre\">push</span></code>.</p><p>As\u00ed, si deseamos enviar un archivo:</p>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/instalacion-grafica-ealite-lxc.png\"><img alt=\"Ventana de instalaci\u00f3n gr\u00e1fica de EALite.\" src=\"../../../../_images/instalacion-grafica-ealite-lxc.png\" style=\"width: 480px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Ventana de instalaci\u00f3n gr\u00e1fica de EALite.</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/ealite-inicio-lxc.png\"><img alt=\"EA Viewer abierto.\" src=\"../../../../_images/ealite-inicio-lxc.png\" style=\"width: 480px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">EA Viewer abierto.</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
